        "name": "Introducing Worldcoin 4941", "description": "Introducing Worldcoin\n\n\nMore
        than three years ago we founded Worldcoin with the ambition of creating a
        new identity and financial network owned by everyone; the rollout begins today.
        If successful, we believe Worldcoin could drastically increase economic opportunity,  scale
        a reliable solution for distinguishing humans from AI online while preserving
        privacy, enable global democratic processes, and eventually show a potential
        path to AI-funded UBI. \n\n\nWorldcoin consists of a privacy-preserving digital
        identity (World ID) and, where laws allow, a digital currency (WLD) received
        simply for being human.  We hope that, where the rules are less clear, such
        as in the U.S., steps will be taken so more people can benefit from both.\n\n\nYou
        can now download World App, the first protocol-compatible wallet, and reserve
        your share. After visiting  an Orb, a biometric verification device, you will
        receive a World ID. This lets you prove you are a real and unique person online
        while remaining completely private. As the global distribution of Orbs is
        ramping up, you can find the closest one and book time to be verified with
        World App and at worldcoin.org.\n\n\nWorldcoin is an attempt at global scale
        alignment, the journey will be challenging and the outcome is uncertain. But
        finding new ways to broadly share the coming  technological prosperity is
        a critical challenge of our time. We hope you\u2019ll join us. \n\n\nAlex
        Blania & Sam Altman", "image_url": "https://ipfs.io/ipfs/bafkreiaclbg5ersxgpekaqdyk4cg73vevjdk4xbejnunbnk7erwpjuaezu",
