        "erc721", "name": "EigenLayer World Builders 62775", "description": "EigenLayer
        World Builders is a commemorative NFT that celebrates the deployment of the
        EigenLayer protocol on Ethereum Mainnet.\n\nWorld Building\n\nThe endgame
        blossoms: new worlds arise. A shining age of human cooperation and innovation
        dawns, built on the bedrock of Ethereum\u2019s trust. A layer of hyperscaled,
        human-centric economic growth, algorithmically enforced and safeguarded in
