        and the World Builders, who boldly strive to attain this shared vision.\n\n\u201cFor
        the builders of the world\nImagination is the limit of innovation\nCollectively
        we are stronger\nTogether we hyperscale Ethereum\u201d\n\nThe collection was
        designed by the Brooklyn-based artist and visual architect untitled, xyz.\n\n\u201cCities
        are built in layers. They are iterations of infrastructure, history, culture
        and materiality that ultimately shape the built world we all experience. This
        series is about exploring those iterations and to celebrate their beginnings.
